import React, {useState, useEffect} from 'react'

const Workspace = () => {
    const [loaded, setLoaded] = useState(false)

    return (
        <>
            {loaded &&
                <div className="main-body">
                    <div className="sidebar">

                    </div>
                    <div className="inner">
                        <div className="view-items-top">
                            <h1>Created Workspace</h1>
                        </div>

                    </div>
                </div>
            }
        </>
    )
}

export default Workspace
